<?phpnamespace App\Http\Resources;use App\Models\CheckOut;use Illuminate\Http\Request;use Illuminate\Http\Resources\Json\JsonResource;/** @mixin CheckOut */class CheckOutResource extends JsonResource{    public function toArray(Request $request): array    {        return [            'id'                    => $this->id,            'check_out_no'          => $this->check_out_no,            'agent_id'              => $this->agent_id,            'user_id'               => $this->user_id,            'payment_method'        => $this->payment_method,            'payment_details'       => $this->payment_details,            'PayerID'               => $this->PayerID,            'coupon_code'           => $this->coupon_code,            'coupon_price'          => $this->coupon_price,            'coupon_type'           => $this->coupon_type,            'coupon_criteria'       => $this->coupon_criteria,            'discounted_price'      => $this->discounted_price,            'discount'              => $this->discount,            'grand_total'           => $this->grand_total,            'pak_price'             => $this->pak_price,            'email'                 => $this->email,            'mobile'                => $this->mobile,            'name'                  => $this->name,            'country'               => $this->country,            'company_name'          => $this->company_name,            'address'               => $this->address,            'paid'                  => $this->paid,            'expired_status'        => $this->expired_status,            'status'                => $this->status,            'created_by'            => $this->created_by,            'updated_at'            => $this->updated_at,            'packageType'           => $this->packageType,            'service_name'          => $this->service_name,            'stripe_customer_id'    => $this->stripe_customer_id,            'stripe_subsription_id' => $this->stripe_subsription_id,            'created_at'            => $this->created_at,            'updated_at'            => $this->updated_at,        ];    }}